import React, { useState } from 'react';
import axios from 'axios';

const AddMerchant = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    
    const newMerchant = { name, email };

    axios.post('https://localhost:7103/api/merchant', newMerchant)
      .then(response => {
        console.log('Merchant added:', response.data);
        setName('');
        setEmail('');
      })
      .catch(err => {
        console.error('Error adding merchant:', err);
      });
  };

  return (
    <div>
      <h2>Add Merchant</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input 
            type="text" 
            value={name} 
            onChange={(e) => setName(e.target.value)} 
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input 
            type="email" 
            value={email} 
            onChange={(e) => setEmail(e.target.value)} 
            required
          />
        </div>
        <button type="submit">Add Merchant</button>
      </form>
    </div>
  );
};

export default AddMerchant;
